import React from "react";
import { BrowserRouter as Router, Route,Routes } from "react-router-dom";
import Home from "./pages/Home"

const App = () => {
  return (
    <Router>

        <Routes>
          <Route path="/" component={Home} exact={Home} />
          </Routes>

    </Router>
  );
};
export default App;
